/**
 * Scheme Results Page - Shows matched schemes with explainability
 */

import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import axios from 'axios';
import LoadingSpinner from '../components/LoadingSpinner';
import SchemeCard from '../components/SchemeCard';

interface Scheme {
  scheme_id: string;
  name: string;
  name_hi?: string;
  name_mr?: string;
  score: number;
  benefit_estimate: number;
  confidence: 'high' | 'medium' | 'low';
  eligibility_status: 'eligible' | 'partially_eligible' | 'ineligible';
  textual_explanation: string;
  textual_explanation_hi?: string;
  textual_explanation_mr?: string;
  matched_rules: Array<{ description: string }>;
  failing_rules: Array<{ description: string }>;
  expected_documents: string[];
}

interface MatchResponse {
  profile_id: string;
  total_schemes_evaluated: number;
  recommendations: Scheme[];
  processing_time_ms: number;
}

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:4000/api/v1';

const SchemeResults: React.FC = () => {
  const { t, i18n } = useTranslation();
  const location = useLocation();
  const navigate = useNavigate();
  
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [schemes, setSchemes] = useState<Scheme[]>([]);
  const [expandedId, setExpandedId] = useState<string | null>(null);

  useEffect(() => {
    const fetchSchemes = async () => {
      try {
        // Get profile from navigation state or localStorage
        const profile = location.state?.profile || 
          JSON.parse(localStorage.getItem('krishi-profile') || '{}');
        
        if (!profile.name) {
          navigate('/profile');
          return;
        }

        // Map frontend profile to API format
        const apiProfile = {
          name: profile.name,
          mobile: profile.mobile || '9876543210',
          state: profile.state,
          district: profile.district,
          village: profile.village,
          land_type: profile.landType,
          acreage: profile.acreage,
          main_crops: profile.mainCrops,
          family_count: profile.familyCount,
          annual_income: profile.annualIncome,
          farmer_type: profile.farmerType
        };

        const response = await axios.post<MatchResponse>(
          `${API_URL}/schemes/match`,
          { profile: apiProfile, top_k: 10 },
          { timeout: 15000 }
        );

        setSchemes(response.data.recommendations);
      } catch (err) {
        console.error('Error fetching schemes:', err);
        setError(t('common.error'));
        
        // Use demo data if API fails
        setSchemes(getDemoSchemes());
      } finally {
        setLoading(false);
      }
    };

    fetchSchemes();
  }, [location.state, navigate, t]);

  const getLocalizedName = (scheme: Scheme): string => {
    if (i18n.language === 'hi' && scheme.name_hi) return scheme.name_hi;
    if (i18n.language === 'mr' && scheme.name_mr) return scheme.name_mr;
    return scheme.name;
  };

  const getLocalizedExplanation = (scheme: Scheme): string => {
    if (i18n.language === 'hi' && scheme.textual_explanation_hi) {
      return scheme.textual_explanation_hi;
    }
    if (i18n.language === 'mr' && scheme.textual_explanation_mr) {
      return scheme.textual_explanation_mr;
    }
    return scheme.textual_explanation;
  };

  if (loading) {
    return <LoadingSpinner />;
  }

  return (
    <div className="max-w-4xl mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold text-gray-900 mb-2">
        {t('schemes.title')}
      </h1>
      <p className="text-gray-600 mb-6">
        {schemes.length} {t('schemes.found')}
      </p>

      {error && (
        <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4 mb-6">
          <p className="text-yellow-800 text-sm">{error}</p>
        </div>
      )}

      {/* Top 3 Schemes */}
      <div className="grid gap-4 mb-8">
        {schemes.slice(0, 3).map((scheme, index) => (
          <SchemeCard
            key={scheme.scheme_id}
            scheme={scheme}
            rank={index + 1}
            isExpanded={expandedId === scheme.scheme_id}
            onToggle={() => setExpandedId(
              expandedId === scheme.scheme_id ? null : scheme.scheme_id
            )}
            localizedName={getLocalizedName(scheme)}
            localizedExplanation={getLocalizedExplanation(scheme)}
          />
        ))}
      </div>

      {/* Other Schemes */}
      {schemes.length > 3 && (
        <>
          <h2 className="text-lg font-semibold text-gray-900 mb-4">
            Other Eligible Schemes
          </h2>
          <div className="grid gap-4">
            {schemes.slice(3).map((scheme) => (
              <SchemeCard
                key={scheme.scheme_id}
                scheme={scheme}
                isExpanded={expandedId === scheme.scheme_id}
                onToggle={() => setExpandedId(
                  expandedId === scheme.scheme_id ? null : scheme.scheme_id
                )}
                localizedName={getLocalizedName(scheme)}
                localizedExplanation={getLocalizedExplanation(scheme)}
              />
            ))}
          </div>
        </>
      )}
    </div>
  );
};

// Demo data for offline/fallback
function getDemoSchemes(): Scheme[] {
  return [
    {
      scheme_id: 'PM-KISAN-001',
      name: 'PM-KISAN Samman Nidhi',
      name_hi: 'पीएम-किसान सम्मान निधि',
      name_mr: 'पीएम-किसान सन्मान निधी',
      score: 95,
      benefit_estimate: 6000,
      confidence: 'high',
      eligibility_status: 'eligible',
      textual_explanation: 'You are fully eligible for PM-KISAN Samman Nidhi. You could receive up to ₹6,000.',
      textual_explanation_hi: 'आप पीएम-किसान सम्मान निधि के लिए पूर्ण रूप से पात्र हैं। आपको ₹6,000 तक मिल सकते हैं।',
      textual_explanation_mr: 'तुम्ही पीएम-किसान सन्मान निधी साठी पूर्णपणे पात्र आहात। तुम्हाला ₹6,000 पर्यंत मिळू शकतात।',
      matched_rules: [
        { description: 'Land holding is 2 hectares or less' },
        { description: 'You are a land owner or tenant' }
      ],
      failing_rules: [],
      expected_documents: ['Aadhaar Card', 'Land Records', 'Bank Passbook']
    },
    {
      scheme_id: 'PMFBY-003',
      name: 'PM Fasal Bima Yojana',
      name_hi: 'प्रधानमंत्री फसल बीमा योजना',
      name_mr: 'प्रधानमंत्री पीक विमा योजना',
      score: 88,
      benefit_estimate: 60000,
      confidence: 'high',
      eligibility_status: 'eligible',
      textual_explanation: 'You are eligible for crop insurance coverage.',
      textual_explanation_hi: 'आप फसल बीमा कवरेज के लिए पात्र हैं।',
      textual_explanation_mr: 'तुम्ही पीक विम्यासाठी पात्र आहात।',
      matched_rules: [
        { description: 'You have cultivable land' },
        { description: 'You grow notified crops' }
      ],
      failing_rules: [],
      expected_documents: ['Aadhaar Card', 'Land Records', 'Sowing Certificate']
    },
    {
      scheme_id: 'KCC-004',
      name: 'Kisan Credit Card',
      name_hi: 'किसान क्रेडिट कार्ड',
      name_mr: 'किसान क्रेडिट कार्ड',
      score: 82,
      benefit_estimate: 150000,
      confidence: 'medium',
      eligibility_status: 'eligible',
      textual_explanation: 'You can get credit at subsidized interest rates.',
      textual_explanation_hi: 'आपको सब्सिडी वाली ब्याज दरों पर क्रेडिट मिल सकती है।',
      textual_explanation_mr: 'तुम्हाला अनुदानित व्याज दरांवर क्रेडिट मिळू शकते।',
      matched_rules: [
        { description: 'You are an owner or tenant farmer' }
      ],
      failing_rules: [],
      expected_documents: ['Aadhaar Card', 'Land Records', 'Bank Account']
    }
  ];
}

export default SchemeResults;
